import React from "react";
import { createRoot, ReactDOM } from "react-dom";
import App from "./App";
const root = createRoot(document.getElementById('root'));
root.render(<App />);
ReactDOM.render(
    <React.StrictMode>
        <App />
    </React.StrictMode>,
    document.getElementById("root")
);
